import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Typography,
  Box,
  Card,
  CardContent,
  Button,
  Grid,
  Avatar,
  Chip,
  CircularProgress,
  Divider,
  Paper,
  Rating
} from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ChatIcon from '@mui/icons-material/Chat';
import { getMatches, Match } from '../services/api';

const MatchesScreen: React.FC = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  const [matches, setMatches] = useState<Match[]>([]);

  // Hardcoded user ID for the demo - in a real app, this would come from auth context or state
  const userId = 1;

  useEffect(() => {
    const fetchMatches = async () => {
      try {
        const response = await getMatches(userId);
        setMatches(response.matches);
      } catch (error) {
        console.error('Error fetching matches:', error);
        // Provide demo data if API fails
        setMatches([
          {
            id: 1,
            matchUserId: 2,
            name: 'Sarah',
            age: 28,
            interests: 'Hiking, Photography, Travel',
            profilePicture: '',
            compatibilityScore: 92,
            conversationTranscript: 'This is a sample conversation transcript.'
          },
          {
            id: 2,
            matchUserId: 3,
            name: 'Michael',
            age: 32,
            interests: 'Reading, Music, Cooking',
            profilePicture: '',
            compatibilityScore: 87,
            conversationTranscript: 'This is another sample conversation transcript.'
          },
          {
            id: 3,
            matchUserId: 4,
            name: 'Emma',
            age: 26,
            interests: 'Yoga, Movies, Art',
            profilePicture: '',
            compatibilityScore: 78,
            conversationTranscript: 'Yet another sample conversation transcript.'
          }
        ]);
      } finally {
        setLoading(false);
      }
    };

    fetchMatches();
  }, [userId]);

  const handleViewConversation = (matchId: number) => {
    navigate(`/conversation/${matchId}`);
  };

  const handleViewTranscript = (matchId: number) => {
    navigate(`/transcript/${matchId}`);
  };

  // Function to render compatibility score as hearts
  const renderCompatibilityScore = (score: number) => {
    // Convert score to 0-5 range for Rating component
    const ratingScore = (score / 100) * 5;
    return (
      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', my: 1 }}>
        <Rating 
          value={ratingScore} 
          readOnly 
          precision={0.5}
          icon={<FavoriteIcon fontSize="inherit" color="error" />}
          emptyIcon={<FavoriteIcon fontSize="inherit" />}
        />
        <Typography variant="h6" sx={{ ml: 1 }}>
          {Math.round(score)}%
        </Typography>
      </Box>
    );
  };

  return (
    <Container maxWidth="lg">
      <Box sx={{ py: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom textAlign="center">
          Your AI-Generated Matches
        </Typography>

        <Typography variant="subtitle1" color="text.secondary" gutterBottom textAlign="center">
          Based on your answers to the 36 questions, our AI has found these compatible matches for you.
        </Typography>

        {loading ? (
          <Box sx={{ display: 'flex', justifyContent: 'center', my: 8 }}>
            <CircularProgress size={60} />
          </Box>
        ) : matches.length > 0 ? (
          <Grid container spacing={4} sx={{ mt: 2 }}>
            {matches.map((match) => (
              <Grid item xs={12} md={6} lg={4} key={match.id}>
                <Card elevation={3} className="match-card">
                  <CardContent>
                    <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', mb: 2 }}>
                      <Avatar 
                        src={match.profilePicture} 
                        sx={{ width: 120, height: 120, mb: 2, bgcolor: 'secondary.main' }}
                      >
                        {match.name[0]}
                      </Avatar>
                      <Typography variant="h5" component="h2" gutterBottom>
                        {match.name}, {match.age}
                      </Typography>

                      <Typography variant="body2" color="text.secondary" gutterBottom>
                        Interests: {match.interests}
                      </Typography>

                      {renderCompatibilityScore(match.compatibilityScore)}
                    </Box>

                    <Divider sx={{ my: 2 }} />

                    <Box sx={{ display: 'flex', justifyContent: 'space-between', mt: 2 }}>
                      <Button 
                        variant="outlined" 
                        color="primary"
                        startIcon={<ChatIcon />}
                        onClick={() => handleViewConversation(match.matchUserId)}
                      >
                        View Conversation
                      </Button>

                      <Button 
                        variant="contained" 
                        color="primary"
                        startIcon={<FavoriteIcon />}
                        onClick={() => handleViewTranscript(match.matchUserId)}
                      >
                        Full Transcript
                      </Button>
                    </Box>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        ) : (
          <Paper sx={{ p: 4, textAlign: 'center', mt: 4 }}>
            <Typography variant="h6" color="text.secondary" gutterBottom>
              No matches found yet.
            </Typography>
            <Typography variant="body1">
              Complete your profile and answer the 36 questions to get matches.
            </Typography>
            <Button 
              variant="contained" 
              color="primary"
              startIcon={<PersonIcon />}
              sx={{ mt: 2 }}
              onClick={() => navigate('/create-profile')}
            >
              Create Profile
            </Button>
          </Paper>
        )}
      </Box>
    </Container>
  );
};

export default MatchesScreen;
